(3, '1．装饰风格分类 中国传统风格：中国传统崇尚庄重和优雅。吸取中国传统木构架构筑室内藻井天棚、屏风、隔扇等装饰。多采用对称的空间构图方式，笔彩庄重而简练，空间气氛宁静雅致而简朴。 乡土风格：主要表现为尊重民间的传统习惯、风土人情，保持民间特色，注意运用地方建筑材料或利用当地的传说故事等作为装饰的主题。在室内环境中力求表现悠闲、舒畅的田园生活情趣，创造自然、质朴、高雅的空间气氛。 自然风格：崇尚返朴归真、回归自然，摒弃人造材料的制品，把木材、砖石、草藤、棉布等天然材料运用于室内设计中。这些做法，在别墅建筑中特别适宜，备受人们喜爱。 复古风格：人们对现代生活要求不断得到满足时，又萌发出一种向往传统、怀念古老饰品、珍爱有艺术价值的传统家具陈设的情绪。于是，曲线优美、<br />\r\n<br />\r\n<br />\r\n', 0, '', 0, 10000, '', 0, 1, '', '弋江区', '10000', 'array (\n  0 => \n  array (\n    ''url'' => ''http://192.168.1.69/jinyaoshi/uploadfile/2016/0129/20160129041938427.png'',\n    ''alt'' => ''logo'',\n  ),\n)', 'http://192.168.1.69/jinyaoshi/uploadfile/2016/0129/20160129041938427.png', 'http://192.168.1.69/jinyaoshi/uploadfile/2016/0129/20160129035519593.jpg', 'http://192.168.1.69/jinyaoshi/uploadfile/2016/0128/20160128113416433.jpg', 'http://192.168.1.69/jinyaoshi/uploadfile/2016/0128/20160128113416433.jpg');
