(71, '<span style="font-family:微软雅黑;">度严审推广资质指的是百度在2016年1月底推出的为防止假售假传播的一种机制，百度成立了专项组，通过升级Flash物料的代码解析模块，让机器主动发现其中&ldquo;不应出现&rdquo;的外链或php脚本内容，整体上从低俗、虚假、欺诈、高危信息等多个维度进行层层把关。据悉，截至目前百度共封禁Flash账户超1.5万个，涉及Flash物料数超570万条，其中机器拒绝违规Flash物料通过共近60万条。</span><br />\r\n<br />\r\n<div style="text-align: center;"><img src="http://192.168.1.69/jinyaoshi/uploadfile/2016/0129/20160129035519593.jpg" /></div>\r\n<br />\r\n', 0, '', 0, 10000, '', 0, '', 0, 1, '|0');
INSERT INTO `jys_page` (`catid`, `title`, `style`, `keywords`, `content`, `template`, `updatetime`) VALUES
(6, '芜湖大恒物流有限公司简介', ';', '大恒 芜湖 物流 简介', '<span style="font-size:16px;">&nbsp; &nbsp; &nbsp; <span style="font-size:22px;">&nbsp; &nbsp;</span></span><span style="font-size:18px;">芜湖大恒物流有限公司成立于2006年元月，注册资本500万元人民币。本着一切为了客户，为了客户一切的服务理念为宗旨，奉行&ldquo;诚实守信、安全准时&rdquo;为准则，竭诚为广大客户提供安全、方便、快捷的物流服务。<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;芜湖大恒物流有限公司铜陵分公司为芜湖大恒物流有限公司全资子公司，于2014年8月正式营业，希望通过公司成员的不断努力，为铜陵各企业单位提供更优质的服务，也是以芜湖为中心，向周边城市形成网络化模式迈开的第一步。<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;我公司于2015年11月份，正式推出小件快运业务，适合个人、单位、电商等客户托运小件，全国4000多个网点覆盖，随着我司小件快运的推出，彻底改善了我公司小件快运的短板，对于小件、零散货物的运输，由原来单一的专线物流报价，转变成快运、专线、拼车相结合的多元化报价体系，有效的降低了物流成本，提供更加全面的物流模式。小件快运，按公斤计费，提供上门取货，送货上门、上楼等增值服务，对于易碎件，异形件，可提供木箱、木架包装，为货物运输保驾护航。<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; 业务范围：<br />\r\n&nbsp; &nbsp; &nbsp; 1、小件快运；<br />\r\n&nbsp; &nbsp; &nbsp;&nbsp;2、设备、配件的木箱包装，定制木箱、木架、木托；特殊设备、大型设备的包装方案设计与包装；<br />\r\n&nbsp; &nbsp; &nbsp;3、零担专线：芜湖、铜陵、马鞍山、宣城直达至：合肥、安庆、五河、泗县、常州、无锡、苏州、昆山、广州、杭州、上海、武汉、南昌、长沙、贵阳、北京、天津、保定、沧州、济南、聊城、青岛、烟台、太原、成都、重庆、昆明、南宁、石家庄、郑州、信阳、西安、沈阳、长春、哈尔滨、兰州、西宁&hellip;&hellip;<br />\r\n&nbsp; &nbsp; &nbsp;4、芜湖、铜陵、马鞍山、宣城及周边城市发往全国各地的整车、零担、散货拼车、配载；<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;芜湖市地处铜陵市、马鞍山市、宣城市三市交汇中心，交通便利，物流线路均已成熟；零担配送、零散拼车、整车调度极度完善，物流市场明显优于铜、马、宣三市，芜湖市物流公司已成为铜陵、马鞍山、宣城三个城市的主要物流调车市场。我公司致力开拓市场，扩张业务，现在已全面覆盖铜陵物流、马鞍山物流、宣城物流，致力打造以芜湖为中心的拉网式物流服务，现已成功在铜陵、马鞍山、宣城三地签约多家固定长期客户，通过不断的技术创新和信息化以及网络化的搭建，提高运输效能，提高服务质量，降低运作成本，降低运输价格，努力让客户提高对我们服务的满意度，为国民经济的持续发展、和谐社会的创建作出积极的贡献。<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; 让我们携手共进，共同创造美好的未来！</span><br />\r\n<br />\r\n', '', 0),
(14, '客户服务', ';', '客户服务', '<div>&nbsp;</div>\r\n<div><span style="font-size:14px;">芜湖公司</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="font-size:14px;">零散业务： 0553-2960887&nbsp;</span><span style="font-size: 14px;">2960885</span></div>\r\n<div><span style="font-size:14px;">大宗业务： 0553-5860890</span></div>\r\n<div><span style="font-size:14px;">13955350890</span></div>\r\n<div><span style="font-size:14px;">电子邮箱:luojunhai@whdhwl.com</span></div>\r\n<div><span style="font-size:14px;">芜湖公司地址：安徽省芜湖市镜湖区长江南路26号（皖江雅居小区隔壁钢材市场院内）</span><br />\r\n<br />\r\n<br />\r\n<div>&nbsp;</div>\r\n<div><span style="font-size:14px;">铜陵分公司</span></div>\r\n<div>&nbsp;</div>\r\n<div><span style="font-size:14px;">电 话： 0562-2651890</span></div>\r\n<div><span style="font-size:14px;">手 机： 18056211890</span></div>\r\n<div><span style="font-size:14px;">铜陵公司地址：安徽省铜陵市狮子山区皖中南物流园（国际汽车城内）</span></div>\r\n<div><span style="font-size:14px;">24小时服务热线：400 600 1890</span></div>\r\n</div>\r\n<br />\r\n', '', 0),
